"""
LeetCode
1930. Unique Length-3 Palindromic Subsequences
November 2023 Challenge
jramaswami

There are only two ways to make a palindrome of length three:
a a a
a b a
"""


import string


class Solution:
    def countPalindromicSubsequence(self, s: str) -> int:
        soln = 0
        for first_letter in string.ascii_lowercase:
            left = s.find(first_letter)
            right = s.rfind(first_letter)
            if right > left:
                t = set(s[left+1:right])
                soln += len(t)
        return soln


def test_1():
    s = "aabcaa"
    expected = 3
    assert Solution().countPalindromicSubsequence(s) == expected


def test_2():
    s = "adc"
    expected = 0
    assert Solution().countPalindromicSubsequence(s) == expected


def test_3():
    s = "bbcbaba"
    expected = 4
    assert Solution().countPalindromicSubsequence(s) == expected


def test_4():
    "TLE"
    s = ""
    expected = 676
    assert Solution().countPalindromicSubsequence(s) == expected